import './App.css';
import React, { Fragment } from 'react';
import { Button, TextField, Icon, Container } from '@material-ui/core';

function App() {

  return (
    <Container>
      <form className="InputForm">
        <Fragment className="nameFrag">
          <label>Name</label>
          <TextField className="inputName" id="outlined-basic" label="Outlined" variant="outlined" />
        </Fragment>
        <Fragment className="dateFrag">
          <label>Date</label>
          <TextField
            className="inputDate"
            id="date"
            label="Birthday"
            type="date"
            defaultValue="2017-05-24"
            InputLabelProps={{
              shrink: true,
            }}
          />
        </Fragment>
        <Fragment className="contextFrag">
          <label>Context</label>
          <TextField className="inputContext" id="outlined-basic" label="Outlined" variant="outlined" fullWidth="true" multiline />
        </Fragment>
        <Fragment>
          <Button
            variant="contained"
            color="primary"
            className="sendBtn"
            endIcon={<Icon>send</Icon>}
          >
            Send
          </Button>
        </Fragment>
      </form>
    </Container>
  );
}

export default App;
